import Items from "./pages/Items";
import Areas from "./pages/Areas";
import Checks from "./pages/Checks";
import NoMatch from "./pages/NoMatch";
import Nav from "./components/Nav";

function App() {
  return (
    <div>
      <Nav />

      <Items />

      <Areas />

      <Checks />
    </div>
  );
}

export default App;
